import React from 'react';

import SHOP_DATA from './shopData';

class Shop extends React.Component {
    constructor(props){
        super(props);
        this.state = {
            collections : SHOP_DATA 
        }
    }

    render(){
        return <div>Shop</div>
    }
}

export default Shop;
